import { View, Text, TextInput, TouchableOpacity, FlatList, StyleSheet } from "react-native";
import { SafeAreaBox } from "../../components";
import React, { useState, useEffect } from "react";
import { useNavigation } from "@react-navigation/native";
import type { NativeStackNavigationProp } from "@react-navigation/native-stack";
import { HomeStackParamList, Topic } from "../types";
import { getDBConnection, getAllTopics, createTables, insertTopics } from "../../database/db-service";

const TopicImages = {
  Contract: require('../../../assets/topics/contract.png'),
  Office: require('../../../assets/topics/office.png'),
  Marketing: require('../../../assets/topics/marketing.png'),
  Computer: require('../../../assets/topics/computer.png'),
  Shopping: require('../../../assets/topics/shopping.png'),
};

export function VocabularyScreen() {
  const navigation = useNavigation<NativeStackNavigationProp<HomeStackParamList>>();
  const [topics, setTopics] = useState<Topic[]>([]);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const loadTopics = async () => {
      try {
        console.log('Starting to load topics...');
        const db = await getDBConnection();
        await createTables(db);
        
        // Chỉ gọi insertTopics với db
        await insertTopics(db);
        console.log('Sample topics inserted');
        
        const loadedTopics = await getAllTopics(db) as Topic[];
        console.log('Loaded topics:', loadedTopics);
        setTopics(loadedTopics);
      } catch (err) {
        console.error('Error loading topics:', err);
        setError('Error loading topics: ' + (err instanceof Error ? err.message : String(err)));
      }
    };

    loadTopics();
  }, []);

  // Hàm xóa chủ đề
  const handleDelete = (id: string) => {
    setTopics(topics.filter(topic => topic.TopicID !== id));
  };

  const handleAddPress = () => {
    try {
      console.log('Navigating to MyLibraryScreen');
      navigation.navigate('MyLibraryScreen');
    } catch (error) {
      console.error('Navigation error:', error);
    }
  };

  return (
    <SafeAreaBox>
      <View style={styles.searchContainer}>
        <TextInput
          placeholder="Nhập chủ đề cần tìm kiếm"
          style={styles.searchInput}
          placeholderTextColor="#666"
        />
      </View>

      {error ? (
        <View style={styles.centerContent}>
          <Text style={styles.errorText}>{error}</Text>
        </View>
      ) : topics.length === 0 ? (
        <View style={styles.centerContent}>
          <Text>Chưa có chủ đề nào</Text>
        </View>
      ) : (
        <View style={styles.rootContainer}>
          <FlatList
            numColumns={2}
            data={topics}
            keyExtractor={(item) => item.TopicID}
            renderItem={({ item }) => (
              <TouchableOpacity 
                style={styles.card}
                onPress={() => navigation.navigate('TopicDetailScreen', { topicId: item.TopicID })}
              >
                <View style={styles.cardContent}>
                  <Text style={styles.title}>{item.TopicName}</Text>
                  <Text style={styles.description} numberOfLines={2}>
                    {item.Description}
                  </Text>
                </View>
              </TouchableOpacity>
            )}
          />
        </View>
      )}

      {/* Nút thêm */}
      <TouchableOpacity style={styles.addButton} onPress={handleAddPress}>
        <Text style={styles.addButtonText}>+</Text>
      </TouchableOpacity>
    </SafeAreaBox>
  );
}

const styles = StyleSheet.create({
  searchContainer: {
    flexDirection: "row",
    marginHorizontal: 16,
    marginTop: 20,
    marginBottom: 16,
    borderWidth: 1,
    borderColor: "#E8E8E8",
    borderRadius: 25,
    backgroundColor: "#F6F6F6",
    alignItems: "center",
    paddingLeft: 16,
    paddingRight: 8,
    height: 40,
  },
  searchInput: {
    flex: 1,
    fontSize: 14,
    color: "#000",
    padding: 0,
    outlineStyle: 'none',
  },
  searchButton: {
    padding: 8,
  },
  searchIcon: {
    fontSize: 16,
  },
  rootContainer: {
    padding: 16,
    flex: 1,
  },
  card: {
    flex: 1,
    margin: 8,
    height: 150,
    backgroundColor: "#e6e6fa",
    borderRadius: 12,
    padding: 16,
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
  },
  cardContent: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  title: {
    fontSize: 18,
    fontWeight: "bold",
    marginBottom: 8,
    color: "#333",
    textAlign: 'center',
  },
  description: {
    fontSize: 14,
    color: "#666",
    textAlign: 'center',
  },
  addButton: {
    backgroundColor: "#4A90E2",
    height: 50,
    width: 50,
    borderRadius: 25,
    justifyContent: "center",
    alignItems: "center",
    alignSelf: "center",
    marginTop: 16,
  },
  addButtonText: {
    color: "#fff",
    fontSize: 24,
    fontWeight: "bold",
  },
  centerContent: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  errorText: {
    color: 'red',
    textAlign: 'center',
  },
});
